sources.styles/reset.scss:
* {
  box-sizing: border-box;
}

body {
  margin: 0;
  font-family: Arial, "Helvetica Neue", Helvetica, sans-serif;
  font-size: 30px;
}

sources.styles/calendar.scss:
.calendar {
  display: flex;
  flex-wrap: wrap;
  width: 706px;
  gap: $size-indent;
  margin: 15vh auto;
}

sources.styles/variables.scss:
$days: (mon: 0, tue: 1, wed: 2, thu: 3, fri: 4, sat: 5, sun: 6);
$size-square: 100px;
$size-indent: 1px;

sources.styles/cycles.scss:
@for $m from 28 through 31 {
  .calendar-#{$m} {
    @for $d from 1 through $m {

      div:nth-child(#{$d}) {
        @include square-styles;

        &:hover {
          @include square-hover;
        }
      }

      div:nth-child(#{$d})::after {
        content: "#{$d}";
      }
    }
  }
}

@each $week-d, $num in $days {
  .calendar-#{$week-d} div:first-child {
    margin-left: ($size-square + $size-indent) * $num;
  }
}

sources.styles/mixin.scss:
@mixin square-styles {
  display: flex;
  justify-content: center;
  align-items: center;
  height: $size-square;
  width: $size-square;
  border: 1px solid #000;
  background-color: #eee;
  transition: background-color 1s, transform 0.5s;
}

@mixin square-hover {
  cursor: pointer;
  background-color: pink;
  transform: translate(0 , -20px);
}
